int gcd(int a, int b) {
  int x = (a < 0 ? -a : a);
  int y = (b < 0 ? -b : b);
  while (y != 0) {
    int t = x % y;
    x = y;
    y = t;
  }
  return x;
}

int find_mod_inverse(int a, int m) {
  if (gcd(a, m) != 1) {
    error("mod inverse of " + (a).toString() + " and " + (m).toString() + " does not exist");
  }
  int u1 = 1;
