  while (v3 != 0) {
    int q = u3 ~/ v3;
    int t1 = u1 - q * v1;
    int t2 = u2 - q * v2;
    int t3 = u3 - q * v3;
    u1 = v1;
    u2 = v2;
    u3 = v3;
    v1 = t1;
    v2 = t2;
    v3 = t3;
  }
  int res = u1 % m;
  if (res < 0) {
